import React from 'react'
import "./Project.css"

function Project(props) {
  return (
    <div className='project-div'>
        <img src={props.info.img} alt=''/>
        <h1>{props.info.name}</h1>
        <p>{props.info.date}</p>
        <button><a href={props.info.link}></a></button>

        
    </div>
  )
}

export default Project
